import React, { useState, useRef } from 'react';
import { DotAutoCaptureUI } from '@innovatrics/dot-auto-capture-ui';
import { DotDocumentAutoCapture } from '@innovatrics/dot-document-auto-capture';
import Button from './ui/Button';

const DocumentCapture = ({ onCaptureComplete, onCancel }) => {
  const [isCapturing, setIsCapturing] = useState(false);
  const [capturedImage, setCapturedImage] = useState(null);
  const captureRef = useRef(null);

  const handleStartCapture = () => {
    setIsCapturing(true);

    // Initialize the document capture
    const autoCapture = new DotDocumentAutoCapture();

    // Configure the capture settings
    const captureConfig = {
      // You can configure various options here
      // For example: document types, quality settings, etc.
    };

    // Start the capture process
    autoCapture.startCapture(captureConfig)
      .then((result) => {
        console.log('Document captured successfully:', result);
        setCapturedImage(result.image);
        setIsCapturing(false);
        if (onCaptureComplete) {
          onCaptureComplete(result);
        }
      })
      .catch((error) => {
        console.error('Document capture failed:', error);
        setIsCapturing(false);
        // Handle error - maybe show a retry option
      });
  };

  const handleRetake = () => {
    setCapturedImage(null);
    setIsCapturing(false);
  };

  const handleConfirm = () => {
    if (onCaptureComplete && capturedImage) {
      onCaptureComplete({ image: capturedImage });
    }
  };

  if (capturedImage) {
    return (
      <div className="flex flex-col items-center space-y-4">
        <div className="w-full max-w-md">
          <img 
            src={capturedImage} 
            alt="Captured Document" 
            className="w-full h-auto rounded-lg border-2 border-gray-300"
          />
        </div>
        <div className="flex space-x-4">
          <Button 
            type="button" 
            onClick={handleRetake}
            className="bg-gray-600 hover:bg-gray-700"
          >
            Retake
          </Button>
          <Button 
            type="button" 
            onClick={handleConfirm}
          >
            Confirm
          </Button>
        </div>
      </div>
    );
  }

  return (
    <div className="flex flex-col items-center space-y-6">
      <div className="text-center">
        <h3 className="text-white text-lg font-semibold mb-2">
          Document Capture
        </h3>
        <p className="text-gray-300 text-sm">
          Position your ID document within the frame and ensure it's well-lit
        </p>
      </div>

      {/* Camera Preview Area */}
      <div className="w-full max-w-md h-64 bg-gray-800 rounded-lg border-2 border-gray-600 flex items-center justify-center">
        {isCapturing ? (
          <div className="text-center">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-white mx-auto mb-4"></div>
            <p className="text-white text-sm">Capturing document...</p>
          </div>
        ) : (
          <div className="text-center">
            <div className="w-16 h-16 bg-gray-700 rounded-lg flex items-center justify-center mx-auto mb-4">
              <svg className="w-8 h-8 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
              </svg>
            </div>
            <p className="text-gray-400 text-sm">Camera preview will appear here</p>
          </div>
        )}
      </div>

      {/* Action Buttons */}
      <div className="flex space-x-4">
        <Button 
          type="button" 
          onClick={onCancel}
          className="bg-gray-600 hover:bg-gray-700"
        >
          Cancel
        </Button>
        <Button 
          type="button" 
          onClick={handleStartCapture}
          disabled={isCapturing}
        >
          {isCapturing ? 'Capturing...' : 'Start Capture'}
        </Button>
      </div>
    </div>
  );
};

export default DocumentCapture;
